import React, { FC } from "react";
import { Button, Input } from "semantic-ui-react";
import "./task.scss";

const Task: FC = () => {
  return (
    <div className="Task">
      <h5 className="name-user">Hello Hashem!</h5>

      <section className="form-countiner">
        <h2>You have 3 tasks today</h2>
        <section className="row-view">
          <Input placholder="What you have today ?" className="input=style" />
          <Button />
        </section>
      </section>
    </div>
  );
};

export default Task;
